import "./App.css";
import NavBar from "./components/navBar";
import React from "react";
import { BrowserRouter } from "react-router-dom";

class App extends React.Component {
  render() {
    return (
      <BrowserRouter>
        <NavBar />
        <main className="Container">
          <Switch>
            <Redirect from="/" exact to="/" />
            <Redirect to="/" />
          </Switch>
        </main>
      </BrowserRouter>
    );
  }
}

export default App;
